package kr.or.ddit.dto;

public class MeetingVO {

	String meeting_no;
	String uuid;
	String topic;
	String join_url;
	String start_time;
	String duration;
	String join_id;
	String join_pw;
	String host_id;
	String start_url;
	String user_id;
	String type;
	String meeting_category_no;
	String meeting_category;
	
	public MeetingVO() {
			// TODO Auto-generated constructor stub
		}

	public MeetingVO(String meeting_no, String topic, String start_time, String duration, String join_pw, String join_url,
				String start_url,String uuid,String user_id,String type,String meeting_category_no, String meeting_category) {
			super();
			this.meeting_no = meeting_no;
			this.topic = topic;
			this.start_time = start_time;
			this.duration = duration;
			this.join_pw = join_pw;
			this.join_url = join_url;
			this.start_url = start_url;
			this.uuid = uuid;
			this.user_id = user_id;
			this.type = type;
			this.meeting_category_no = meeting_category_no;
			this.meeting_category = meeting_category;
		}
	
	
	
	public String getMeeting_category_no() {
		return meeting_category_no;
	}

	public void setMeeting_category_no(String meeting_category_no) {
		this.meeting_category_no = meeting_category_no;
	}

	public String getMeeting_category() {
		return meeting_category;
	}

	public void setMeeting_category(String meeting_category) {
		this.meeting_category = meeting_category;
	}

	public String getMeeting_no() {
		return meeting_no;
	}

	public void setMeeting_no(String meeting_no) {
		this.meeting_no = meeting_no;
	}

	public String getUuid() {
		return uuid;
	}

	public void setUuid(String uuid) {
		this.uuid = uuid;
	}

	public String getTopic() {
		return topic;
	}

	public void setTopic(String topic) {
		this.topic = topic;
	}

	public String getJoin_url() {
		return join_url;
	}

	public void setJoin_url(String join_url) {
		this.join_url = join_url;
	}

	public String getStart_time() {
		return start_time;
	}

	public void setStart_time(String start_time) {
		this.start_time = start_time;
	}

	public String getDuration() {
		return duration;
	}

	public void setDuration(String duration) {
		this.duration = duration;
	}

	public String getJoin_id() {
		return join_id;
	}

	public void setJoin_id(String join_id) {
		this.join_id = join_id;
	}

	public String getJoin_pw() {
		return join_pw;
	}

	public void setJoin_pw(String join_pw) {
		this.join_pw = join_pw;
	}

	public String getHost_id() {
		return host_id;
	}

	public void setHost_id(String host_id) {
		this.host_id = host_id;
	}

	public String getStart_url() {
		return start_url;
	}

	public void setStart_url(String start_url) {
		this.start_url = start_url;
	}

	public String getUser_id() {
		return user_id;
	}

	public void setUser_id(String user_id) {
		this.user_id = user_id;
	}

	public String getType() {
		return type;
	}

	public void setType(String type) {
		this.type = type;
	}

	@Override
	public String toString() {
		return "MeetingVO [meeting_no=" + meeting_no + ", uuid=" + uuid + ", topic=" + topic + ", join_url=" + join_url
				+ ", start_time=" + start_time + ", duration=" + duration + ", join_id=" + join_id + ", join_pw="
				+ join_pw + ", host_id=" + host_id + ", start_url=" + start_url + ", user_id=" + user_id + ", type="
				+ type + "]";
	}

	
	

}
